import Navbar from './components/Navbar/Navbar';
import './App.css';
import { BrowserRouter, Routes,Route } from 'react-router-dom';
import Layout from './Layout';

function App() {
  return (
    <div className="App">
    <BrowserRouter>
    <Routes>
    <Route element={<Layout/>}></Route>
    </Routes>
    </BrowserRouter>
    </div>
    );
}

export default App;
